window.onload=function(){
   ('.sidenav-toggle').on('click', function() {
         varsidenav,this;
        
        sidenav =('.ct-sidenav');
         if ($this.hasClass('active')) {
          this.removeClass('active');
           returnsidenav.removeClass('active');
         } else {
          this.addClass('active');
           returnsidenav.addClass('active');
         }
       });
      ('#sidenav-toggle').on('click', function() {
         varsidenav,this;
       
        sidenav =('.ct-sidenav');
         if ($this.hasClass('open')) {
          this.removeClass('open');
           returnsidenav.removeClass('open');
         } else {
          this.addClass('open');
           returnsidenav.addClass('open');
         }
       });
      ('.ct-sidenav').find('button.close').on('click', function() {
        (this).parent().removeClass('open');
         return('#sidenav-toggle').removeClass('open');
       });
   
   }
